description:
Verenigd Koninkrijk / Verenigde Staten
Horror / Thriller
91 minuten

een goeie film

met Emily Blunt, Martin Donovan en Ashton Holmes

Tijdens de Kerstvakantie reizen twee studenten samen per auto naar hun families. Omdat er een zware winterstorm aankomt nemen 
ze een snellere route over een verlaten landweg. Ze komen er al snel achter dat ze dit beter niet hadden kunnen doen, aangezien 
ze buiten het noodweer te maken krijgen met geesten en de sinistere geschiedenis van de betreffende weg.
